    return {
      type: 'LOGIN_USER',
      email: email,
      password: password, 
      isLogIn: isLoginIn
    }
  }

  
export function logoutUserAction(){
    return {
      type: 'LOGOUT_USER'      
    }
  }

  
  export function registerUserAction(email,password) {
